webpackJsonp([0x78836e5cab77],{3392:function(n,l){n.exports={data:{markdownRemark:{html:"<p>画面写真の通り、早い話がイライラ棒です。\n(真っ黒？コントラスト＆ブライトネスを最大にしてよーく見てみよう)</p>\n<p>画面が上へ上へと強制スクロールして行き、プレイヤーは黄色いドットの主人公(自機？)を操作して、洞窟の中を飛んでいきます。\nそして青い壁にぶつかるとゲームオーバーと言ったシンプルなゲームです。</p>\n<p>確かこのゲームで生まれて初めてランダム機能を使用しました。\nなお、このゲームにはレベル設定が 1～9 まであり、もし間違えて 9 などと設定した日には 1～2 ドットの隙間を潜り抜けることとなります。</p>\n<ul>\n<li>ジャンル: アクション</li>\n<li>開発言語: N88-日本語BASIC(86)</li>\n<li>推奨環境: intel 80286 12MHz以上</li>\n<li>ソース紛失のため頒布はありません。</li>\n</ul>",frontmatter:{cover:null,date:"1995-05-01T00:00:00+09:00",strDate:"1995/4/30",title:"DANGEON FLY"}}},pathContext:{path:"/ja/blog/1995/05/01-dangeon-fly/",langKey:"ja"}}}});
